function Post(props) {
  const [filter, setFilter] = useState({ keyword: '' });
  const [list, setList] = useState(initList);
  const [page, setPage] = useState(1);
  const [selected, setSelected] = useState(1);
  const PER_PAGE = 12;

  const count = Math.ceil(list.length / PER_PAGE) || 1;
  const _LIST = usePagination(list, PER_PAGE);

  const handleFilterChange = (value) => {
    const newFilter = { ...filter, ...value };
    setList(
      initList.filter((x) => x.title.toLowerCase().includes(newFilter.keyword.toLowerCase().trim()))
    );
    setFilter(newFilter);

    //reset select, pagination
    handleSelectChange(1);
    handlePaginationChange(null, 1);
  };

  const handleSelectChange = (value) => {
    switch (value) {
      case 1:
        setList((pre) => [...pre].sort((a, b) => b.createDate.getTime() - a.createDate.getTime()));
        break;
      case 2:
        setList((pre) => [...pre].sort((a, b) => a.createDate.getTime() - b.createDate.getTime()));
        break;
    }

    setSelected(value);
  };

  const handlePaginationChange = (e, page) => {
    setPage(page);
    _LIST.jump(page);
  };

  return (
    <Container>
      <PostHeader />
      <PostToolBar
        onSearchChange={handleFilterChange}
        onSelectChange={handleSelectChange}
        selected={selected}
      />
      <PostList list={_LIST.currentData()} />
      <PostPagination count={count} page={page} onChange={handlePaginationChange} />
    </Container>
  );
}

export default Post;
